defs.script:
var a5_idx;
var a5_on;
var a5_fr;
var a5_btnPauseLeft,a5_btnPlayLeft,a5_btnPauseRight,a5_btnPlayRight;
var a5_playsRight,a5_isPaused,a5_playing;
var a5_int;
var a5_pause,a5_playRight,a5_playLeft,a5_playBwd,a5_playFwd;
var a5_fps,a5_spd;
var a5_setFps;
var a5_seekFrame,a5_gotoNext,a5_gotoPrev;
var a5_stopFirst,a5_stopLast;
var a5_playPauseBwd,a5_playPauseFwd;
var a5_stepBwd,a5_stepFwd;
var a5_spdIncr,a5_spdDecr,a5_spdReset;
(function(){
function onload(){
if(!a5_fr){
a5_fr=new Array();
a5_on=0;
var ocg=document.getElementsByClassName('ocg');
for(var i=0;i<ocg.length;i++){
var ocgName=ocg[i].getAttribute('id').split('.');
if(ocgName[0]==5){
a5_fr[ocgName[1]]=ocg[i];
}
}
a5_btnPauseLeft=document.getElementById('5.PauseLeft');
a5_btnPlayLeft=document.getElementById('5.PlayLeft');
a5_btnPauseRight=document.getElementById('5.PauseRight');
a5_btnPlayRight=document.getElementById('5.PlayRight');
a5_playsRight=true;
a5_isPaused=false;
a5_playing=false;
a5_fps=24;
a5_spd=1;
a5_setFps=function(f){
a5_fps=(f==0?1e-6:f);
if(a5_playing){
if(a5_playsRight){a5_playRight();}else{a5_playLeft();}
}
};
a5_seekFrame=function(f){
if(f>207||f<0){return -1;}
a5_idx=f;
a5_fr[a5_on].setAttribute('visibility','hidden');
a5_fr[f].setAttribute('visibility','visible');
a5_on=f;
return 0;
};
a5_stopFirst=function(){a5_pause(true);a5_seekFrame(0);};
a5_stopLast=function(){a5_pause(true);a5_seekFrame(207);};
a5_gotoNext=function(){
if(a5_seekFrame(a5_idx+1)<0){
a5_stopLast();
}
};
a5_gotoPrev=function(){
if(a5_seekFrame(a5_idx-1)<0){
a5_stopFirst();
}
};
a5_pause=function(stop){
try{clearInterval(a5_int);}catch(e){}
a5_playing=false;
a5_isPaused=!stop;
a5_btnPauseLeft.setAttribute('visibility','hidden');
a5_btnPlayLeft.setAttribute('visibility','visible');
a5_btnPauseRight.setAttribute('visibility','hidden');
a5_btnPlayRight.setAttribute('visibility','visible');
};
a5_playRight=function(){
var tmp_int;
try{tmp_int=setInterval('a5_gotoNext()',1000/a5_fps/a5_spd);}catch(e){}
try{clearInterval(a5_int);}catch(e){}
a5_int=tmp_int;
a5_playsRight=true;
a5_playing=true;
a5_isPaused=false;
a5_btnPauseLeft.setAttribute('visibility','visible');
a5_btnPlayLeft.setAttribute('visibility','hidden');
a5_btnPauseRight.setAttribute('visibility','visible');
a5_btnPlayRight.setAttribute('visibility','hidden');
};
a5_playLeft=function(){
var tmp_int;
try{tmp_int=setInterval('a5_gotoPrev()',1000/a5_fps/a5_spd);}catch(e){}
try{clearInterval(a5_int);}catch(e){}
a5_int=tmp_int;
a5_playsRight=false;
a5_playing=true;
a5_isPaused=false;
a5_btnPauseLeft.setAttribute('visibility','visible');
a5_btnPlayLeft.setAttribute('visibility','hidden');
a5_btnPauseRight.setAttribute('visibility','visible');
a5_btnPlayRight.setAttribute('visibility','hidden');
};
a5_playPauseBwd=function(){if(a5_playing){a5_pause();}else{a5_playBwd();}};
a5_playPauseFwd=function(){if(a5_playing){a5_pause();}else{a5_playFwd();}};
a5_spdIncr=function(){a5_spd*=1.1;a5_setFps(a5_fps);};
a5_spdDecr=function(){a5_spd/=1.1;a5_setFps(a5_fps);};
a5_spdReset=function(){a5_spd=1;a5_setFps(a5_fps);};
a5_stepBwd=function(){if(!a5_playing){a5_seekFrame(a5_idx-1);a5_isPaused=true;}};
a5_stepFwd=function(){if(!a5_playing){a5_seekFrame(a5_idx+1);a5_isPaused=true;}};
a5_playBwd=function(){if(a5_idx==0){a5_stopLast();}a5_playLeft();};
a5_playFwd=function(){if(a5_idx==207){a5_stopFirst();}a5_playRight();};
a5_seekFrame(0);
}
document.getElementById('anm5').addEventListener('mouseup',onMouseUpWdgt);
document.getElementById('anm5').addEventListener('mousedown',onMouseDownWdgt);
document.getElementById('anm5').addEventListener('touchend',onTouchEndWdgt);
onvisible();
}
function onvisible(){
if(a5_playsRight){a5_playFwd();}else{a5_playBwd();}
}
function onhidden(){
if(a5_playing){a5_pause(true);}
if(!a5_isPaused)a5_playsRight=true;
if(!a5_isPaused&&a5_idx!=0)a5_seekFrame(0);
}
function onVisibilityChange(){
if(document.hidden){try{onhidden();}catch(e){}}else{try{onvisible();}catch(e){}}
}
document.addEventListener('visibilitychange',onVisibilityChange);
window.addEventListener('load',onload);
function onWidgetUpAction(event){
try{
if(event.shiftKey)a5_playsRight=!a5_playsRight;
var doplay=true;
if(a5_idx==207&&a5_playsRight){a5_stopFirst();}
if(a5_idx==0&&!a5_playsRight){a5_stopLast();}
if(doplay){if(a5_playsRight){a5_playRight();}else{a5_playLeft();}}
}catch(e){}
}
function onTouchEndWdgt(event){
event.preventDefault();event.stopPropagation();
if(a5_playing){try{a5_pause();}catch(e){}}else{
try{
if(event.shiftKey)a5_playsRight=!a5_playsRight;
var doplay=true;
if(a5_idx==207&&a5_playsRight){a5_stopFirst();}
if(a5_idx==0&&!a5_playsRight){a5_stopLast();}
if(doplay){if(a5_playsRight){a5_playRight();}else{a5_playLeft();}}
}catch(e){}
}
}
function onMouseDownWdgt(event){
event.preventDefault();event.stopPropagation();
try{if(a5_playing){a5_pause();}}catch(e){}
}
function onMouseUpWdgt(event){
event.preventDefault();event.stopPropagation();
onWidgetUpAction(event);
}
})();
